        public void Clear()
        {
            using (var scope = _scopeFactory.CreateScope())
            {
                var context = scope.ServiceProvider.GetRequiredService<WormCatRazorContext>();

                if (context == null || context.Book == null)
                {
                    throw new ArgumentNullException("Null RazorPagesMovieContext");
                }

                _log.LogInformation("Clearing database");

                context.Book.RemoveRange(context.Book);
                context.Record.RemoveRange(context.Record);
                context.Container.RemoveRange(context.Container);
                context.Location.RemoveRange(context.Location);

                context.SaveChanges();
            }
        }
